import React,{Component} from 'react'

class simple extends Component {
    
    constructor(props) {
    super(props);
        this.state={
            car:0
        }
    }
    componentWillUpdate(){
        this.setState(()=>{
            return {
                car: 2}
        })  
    }
    
    
    
    render(){
        return(
        
            <p>This is simple{this.props.match.params.year},{this.state.car}</p>    
        )
    }
}


export default simple
